def rle_encode(data):
    """Kompresja RLE"""
    encoded = []
    i = 0
    while i < len(data):
        count = 1
        while i + 1 < len(data) and data[i] == data[i + 1]:
            count += 1
            i += 1
        encoded.append((data[i], count))
        i += 1
    return encoded

def rle_decode(encoded):
    """Dekompresja RLE"""
    decoded = []
    for char, count in encoded:
        decoded.append(char * count)
    return ''.join(decoded)

# Przykład działania
if __name__ == "__main__":
    original_data = ""
    print(f"Oryginalne dane: {len(original_data)}")

    # Kompresja RLE
    encoded_data = rle_encode(original_data)
    print(f"Skompresowane dane (RLE): {len(encoded_data)}")

    # Dekompresja RLE
    decoded_data = rle_decode(encoded_data)
    print(f"Zdekompresowane dane: {len(decoded_data)}")

    # Sprawdzenie poprawności
    assert original_data == decoded_data, "Dekompresja nie zgadza się z oryginałem!"
